import ReactPaginate from "react-paginate";
import { ChevronLeft, ChevronRight } from "lucide-react";

interface Props {
  pageCount: number;
  onPageChange: (page: number) => void;
}

export default function Pagination({ pageCount, onPageChange }: Props) {
  return (
    <ReactPaginate
      previousLabel={<ChevronLeft className="w-4 h-4" />}
      nextLabel={<ChevronRight className="w-4 h-4" />}
      breakLabel="..."
      pageCount={pageCount}
      marginPagesDisplayed={1}
      pageRangeDisplayed={3}
      onPageChange={(event) => onPageChange(event.selected + 1)}
      containerClassName="flex items-center justify-center gap-2 mt-8"
      pageClassName="px-3 py-2 border rounded cursor-pointer"
      activeClassName="bg-blue-600 text-white"
      previousClassName="px-3 py-2 border rounded"
      nextClassName="px-3 py-2 border rounded"
      disabledClassName="opacity-50 cursor-not-allowed"
    />
  );
}

import Pagination from "components/pagination/Pagination";

const BlogList: FC<BlogListProps> = ({ posts, type = 'vertical', link }) => {
  const postsPerPage = 9;
  const [currentPage, setCurrentPage] = useState(1);

  const totalPages = Math.ceil(posts.length / postsPerPage);

  const startIndex = (currentPage - 1) * postsPerPage;
  const currentPosts = posts.slice(startIndex, startIndex + postsPerPage);

  return (
    <div className="flex flex-col gap-8">

      {/* GRID LIST */}
      <div className={isVertical ? "grid gap-6 sm:grid-cols-2 md:grid-cols-3" : "grid gap-6 sm:grid-cols-2"}>
        {currentPosts.map((post) =>
          isVertical ? (
            <VerticalBlogCard key={post._id} post={post} link={link} />
          ) : (
            <HorizontalBlogCard key={post._id} post={post} link={link} />
          )
        )}
      </div>

      {/* NEW PAGINATION */}
      {totalPages > 1 && (
        <Pagination
          pageCount={totalPages}
          onPageChange={setCurrentPage}
        />
      )}
    </div>
  );
};

